import React from "react";
import { Link } from "react-router-dom";
import Header from '../components/Header';
import Carousel from '../components/Carousel';


function Home() {
  return (
    <div>
      <Header />
      <Carousel />
      <div>
        <h1>Footer</h1>
      </div>
    </div>
  );
}

export default Home;
